import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick-theme.css";
import "slick-carousel/slick/slick.css";
const Home = () => {
  const settings = {
    dots: true,
    className: "center",
    centerMode: true,
    infinite: true,
    centerPadding: "60px",
    slidesToShow: 2,
    autoplay: true,
    speed: 2000,
    autoplaySpeed: 2000,
  };
  return (
    <div>
      <Slider {...settings}>
        <div>
          <h3>Slick Slide 1</h3>
        </div>
        <div>
          <h3>Slick Slide 2</h3>
        </div>
        <div>
          <h3>Slick Slide 3</h3>
        </div>
        <div>
          <h3>Slick Slide 4</h3>
        </div>
        <div>
          <h3>Slick Slide 5</h3>
        </div>
      </Slider>
    </div>
  );
};

export default Home;
